    return(
        <div className="vacation-spot">
            <img src={props.imgURL}/>
            <h4>{props.place}</h4>
            <p><b>Price:</b> {props.price}</p>
            <p><b></b>Time To Go: {props.timeToGo}</p>
        </div>
    )
}

